package com.onecare.admin.page;

import org.openqa.selenium.WebElement;

import org.openqa.selenium.support.FindBy;

import org.openqa.selenium.support.PageFactory;

import org.testng.Reporter;

import com.onecare.admin.base.BaseClass;

public class LoginPage extends BaseClass {

	@FindBy(id ="inputEmail")

	WebElement username;

	@FindBy(id="inputPassword")

	WebElement password;

	@FindBy(xpath ="//button[text()='Login']")

	WebElement loginbt;

	@FindBy(xpath = "/html/body/div/nav/div/a/img")

	WebElement onecarelogo;

	public LoginPage() {

		PageFactory.initElements(driver, this);

	}


	public boolean OneDataLogo() {

		return onecarelogo.isDisplayed();

	}

	public OrganizationPage login(String un,String pwd) {

		Reporter.log("valid User name is enter");

		username.sendKeys(un);

	    Reporter.log("valid passwod is enter");

		password.sendKeys(pwd);

		Reporter.log("Click Login Button");

		loginbt.click();

		return new OrganizationPage();

	}

}

